	const EmployeeForm = () => (
		<div>
			<Header />
			<div className="row container">
				<div className="col-sm-3">
					<Sidebar />
				</div>

				<div className="col-sm-9">
					<table>
						<tr>
							<th colSpan="2">Name</th>
							<th>Email</th>
							<th>Action</th>
						</tr>

						<tr>
							<td>hh</td>
							<td>hh</td>
							<td>hh</td>
						</tr>
					</table>
				</div>
			</div>
		</div>
	);

	return <div>{EmployeeForm()}</div>;
};

EmployeeList.propTypes = {};

export default EmployeeList;
